import React from 'react';
import { Container} from 'react-bootstrap';
import NavbarButom from '../components/NavbarButom';

const HomePage = () => {
  return (
  <div
      style={{
        backgroundColor: "#3500ff",
        minHeight: "100vh",
        color: "white",
        padding: "2rem",
        overflow: "hidden",
        position: "relative",
      }}
    >
      <Container fluid >
        <Container fluid >
          <div style={{ position: "relative", zIndex: 2 }}>
            <div>
              <div style={{ position: "relative", zIndex: 2 }}></div>
              <h1 className="display-1 fw-bold text-end"
              //  style={{ textTransform: 'uppercase', fontSize:"8rem" ,lineHeight: '0.8', letterSpacing:"1.1,"}}
              style={{
              fontFamily: "Anton, sans-serif",
              textTransform: "uppercase",
              transform: "perspective(800px) rotateY(-30deg)",
              transformOrigin: "center right",
              lineHeight: 1.1,
              letterSpacing: "-0.02em",
              fontSize: "6rem",
              color: "#000",
              textShadow: "2px 2px 0 #fff",
              wordWrap: "break-word",
            }}>
               Studio<br />Mega<br />The<br />Brigade<br />Push<br />Onx
               Studio<br />Mega<br />The<br />Brigade<br />Push<br />Onx
              </h1>
            </div>
          </div>
        </Container>
      <div
        style={{
          position: 'fixed',
          bottom: 80,
          left: 40,
          zIndex: 1000,
        }}
      >
         <div>
              <h1 className='' style={{ fontWeight: '900', lineHeight: '0.8', fontSize: '3rem' }}>VAN<br />HOLTZ<br />CO.</h1>
            </div>
        <NavbarButom />
        </div>
      </Container>
    </div>
  );
};

export default HomePage;
